import React, { useState } from "react";

import { Form } from "react-bootstrap";


const Contact = () => {
    const [d,Sdata]=useState({
    fullname:"jksadfjlk",
    phone:"dksljf",
    email:"dkk",
    msg:"kkdsjf",
});
    // const I=(val)=>{

        // sd(val.target.value)
        // console.log(d);
        // }

const Inputfun=(event)=>
{
    const [name,value]=event.target;

    Sdata((preval)=>{
       return{... preval,
        [name]: value,} ;

    });

};

const Formsub=(e)=>{
    e.preventDefault();
    alert("form submited successfully");
};

    return (<>

        <div className="container mx-auto mt-5">
        <div className="row">

            <div className="col-12 d-flex align-content-center">

        <div className="my-5">
            <h1 className="text-center">Contact US</h1>
        </div>
        <div className="container contact-dv">

            <div className="row ">

                <div className="col-md-6 col-10 mx-auto">

                    <Form onSubmit={Formsub}>

                        <div className="mb-3">
                            <label for="exampleFormControlInput1" className="form-label">FullName</label>
                            <input type="text" value={d.fullname}  name="fullname" onChange={Inputfun}  className="form-control" id="exampleFormControlInput1" placeholder="Enter Your Name"/ >
                        </div>

                          <div className="mb-3">
                        <label for="exampleFormControlInput1" className="form-label">Phone</label>
                        <input type="number" name="phone" onChange={Inputfun}  value={d.phone} className="form-control" id="exampleFormControlInput1" placeholder="Enter Your Number" />
                    </div>

                    <div className="mb-3">
                    <label for="exampleFormControlInput1" className="form-label">Email</label>
                    <input type="text" onChange={Inputfun}   name="email" value={d.email} className="form-control" id="exampleFormControlInput1" placeholder="Eneter Your Email" />
                </div>


                        <div className="mb-3">
                            <label for="exampleFormControlTextarea1" className="form-label">Message</label>
                            <textarea name="msg" onChange={Inputfun}  value={d.msg} className="form-control" id="exampleFormControlTextarea1" rows="3"></textarea>
                        </div>


                        <button type="submit" onChange={Inputfun}  class="btn btn-primary">Submit</button>
                    </Form>
                </div>

            </div>

        </div>
        </div>
        </div>
        </div>
    </>);
}
export default Contact;
